import React from "react";
import animals from "./Animals";
import AnimalCard from "./AnimalCard";

function Container() {
  return (
    <div>
      {animals.map((animal) => (
        <AnimalCard src={animal.src} />
      ))}
    </div>
  );
}

export default Container;
